import React, { Component } from 'react';
import './Main3content.css';


class Main3content extends Component {
  render() {
    return (
      <div className="main3content">
        <div id = "main3content">
          <h2 className="main3content__title">
            <p> Area 2071</p>
            <p>Environment</p>
          </h2>

          <div className="main3content__text">
              <p>In the space, innovators will meet and use the best technology 
                of today to design the future
              </p>

              <p className="main3content__text-button"><a> LEARN MORE &#8594; </a></p>
          </div>
        </div>
      </div>
    );
  }
}

export default Main3content;
